import React from 'react'
import useAuth from './Auth'
import { useNavigate } from 'react-router-dom'

 const Profile = () => {
  const auth=useAuth()
  const handlelogout =() =>{
    auth.logout()
  }
  return (
    <div>Welcome {auth.user}
    <button onClick={handlelogout}> Logout</button></div>
  )
}
export default Profile
